INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24001, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, "リン", 1, "あたしだって\nやるときはやるよ！", 0.0, 24, 0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24002, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, "リン", 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 24, 1);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24003, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, "リン", 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 24, 2);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24004, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 2, "リン", 2, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 24, 3);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24005, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, "リン", 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 24, 4);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24006, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 2, "リン", 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 24, 5);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24007, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 2, "リン", 2, "あたしも意外と\nやるもんでしょ？", 0.0, 24, 6);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24008, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, "リン", 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 24, 7);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24009, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, "リン", 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 24, 8);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24010, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, "リン", 4, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 24, 9);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24011, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, "リン", 4, "やられた…\nねずみって意外と\nてごわいね", 0.0, 24, 10);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24012, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, "リン", 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 24, 11);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 24013, 0.0, 10040, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, "リン", 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 1.81, 24, 12);
